import React, { Component} from'react'
import axios from 'axios'

class StorageGraft extends Component{
    constructor(props){
        super(props);
        this.state={
            Aggregate:[],
            Svm:[],
        }
    }
    componentDidMount(){
        let TotalAmount=0;
        let UsedAmount=0;
        let SVMSArray;
        console.log(this.props)
        axios.get(`http://localhost:3000/Aggregate/Aggre/${this.props.Aggre}`)
        .then(async(res)=>{
            console.log(res.data)
            if(res.data[0]){
                TotalAmount=res.data[0].TotalAmount; 
                UsedAmount=res.data[0].Amount;
            }
            await axios.get(`http://localhost:3000/SvmRoute/SvmByAggreName/${this.props.Aggre}`)
            .then((res)=>{
            console.log(res.data)
            SVMSArray=res.data

            });
         });
    
    }
    getBar(){
        return(
            <div className="progress-bar progress-bar-striped bg-success"
            role="progressbar"
            style={{width:100}}>
                {100}%
        </div>
        )
    }
    render(){
        return(
                <div className="progress">
                    <div className="progress-bar progress-bar-striped bg-success"
                        role="progressbar"
                        style={{width:100}}>
                            {100}%
                    </div>
                    {this.getBar()}
                </div>
            );
    }

}
export default StorageGraft
